          <h1>Job Portal</h1>
        </div>
      </header>
      <main className="app-main">
        <h1>Hello, Job Portal!</h1>
      </main>
      <footer className="app-footer">
        <p>&copy; 2023 Job Portal System. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
